/*!50003 CREATE*/ /*!50017 DEFINER=`avnadmin`@`%`*/ /*!50003 TRIGGER `trg_after_insert_Operations` AFTER INSERT ON `Operations` FOR EACH ROW BEGIN
  IF NEW.operation_type = 'rent' THEN
    INSERT INTO Rentals (fk_operation_id_rental,rent_date, return_date)
    VALUES (
      NEW.operation_id,NEW.operation_date,
      DATE_ADD(NEW.operation_date, INTERVAL 30 DAY)
    );
  ELSEIF NEW.operation_type = 'sale' THEN
    INSERT INTO Sales (fk_operation_id_sale,sale_date)
    VALUES (
      NEW.operation_id,NEW.operation_date
      
    );
  END IF;
END */;;
